import * as React from 'react';

import {
    Card,
    Cards,
    Layout,
} from 'one-ui-layout';
import Icon from 'antd/lib/icon';
import { useDispatch } from 'react-redux';

import { Patient } from 'one-micro-patient';
interface Props {
}

export const App = (props: Props) => {
    const dispatch = useDispatch();

    return (
        <Layout>
            <Cards>
                <Card titleLabel="Test" footerActions={[
                    <Icon type="setting" />,
                    <Icon type="edit" />,
                    <Icon type="ellipsis" />
                ]}>
                    <Patient />
                </Card>
                <Card titleLabel="Test"></Card>
                <Card titleLabel="Test"></Card>
                <Card vscale={3} span={16} titleLabel="Test" footerActions={[
                    <Icon type="setting" />,
                    <Icon type="edit" />,
                    <Icon type="ellipsis" />
                ]}></Card>
                <Card vscale={2} titleLabel="Test" footerActions={[
                    <Icon type="setting" />,
                    <Icon type="edit" />,
                    <Icon type="ellipsis" />
                ]}></Card>
                <Card titleLabel="Test" footerActions={[
                    <Icon type="setting" />,
                    <Icon type="edit" />,
                    <Icon type="ellipsis" />
                ]}></Card>
            </Cards>
        </Layout>
    );
}
